        long result = operand[0];
        for (int i = 0; i < op.Count; i++) {
            switch (op[i]) {
                case "+":
                    result += operand[i + 1];
                    break;
                case "-":
                    result -= operand[i + 1];
                    break;
                case "*":
                    result *= operand[i + 1];
                    break;
                case "//":
                    result /= operand[i + 1];
                    break;
                case "**":
                    result = (long)Math.Pow(result, operand[i + 1]);
                    break;
            }
        }
        return result;

