    // Examples:
    // >>> MatchParens((new List<string>(new string[]{(string)"()(", (string)")"})))
    // ("Yes")
    // >>> MatchParens((new List<string>(new string[]{(string)")", (string)")"})))
    // ("No")
    public static string MatchParens(List<string> lst) {
        // Write your code here
        var stack = new Stack<char>();
        foreach (var s in lst) {
            foreach (var c in s) {
                if (c == '(') {
                    stack.Push(c);
                } else {
                    if (stack.Count == 0) {
                        return "No";
                    }
                    stack.Pop();
                }
            }
        }
        return stack.Count == 0 ? "Yes" : "No";

