            for (int j = 0; j < i; j++) {
                if (arr[i] == arr[j]) {
                    dp[i] = Math.Min(dp[i], dp[j]);
                } else {
                    dp[i] = Math.Min(dp[i], dp[j] + 1);
                }
            }
        }
        return dp[n - 1];

